import { personType} from './person-type.model';
import {employmentType} from './employment.model';
import { session } from './session.model';
import { person } from './person.model';
import { attendee } from './attendee.model';

export class register{

    //Fields 
    attendee: attendee
    sessionOne: session
    sessionTwo: session
    isEmployed: boolean
    employmentType: employmentType
    personType: personType



    constructor (){
           this.attendee = new person();
           this.isAttendingDinner = false;
           this.school = "";
           this.sessionOne = new session();
           this.sessionTwo = new session();
           this.personType = personType.student;
           this.isEmployed = false; 
           this.employmentType = employmentType.unset;
    }

}
